import React from 'react';
import s from './cost.module.css'

const Cost = (props) => {
    return (
        <div>
            <div>
                <p className={s.question}>Была ли ванна ранее чем-то покрыта?</p>
                <div className={s.answerBar}>
                    Выберете ответ:
                <b>Нет</b> <input type="radio" name="cover" value="no" />| 
                <b> Да</b> <input type="radio" name="cover" value="yeas" />
                </div>
            </div>
        </div>
    )
}
export default Cost;
